Just My Imagination (1993) [VHSRip]

Chantilly Lace, Chris Collins, Cory Cox, Leanna Foxxx, Tara Gold, Tina Tyler, Jonathan Morgan, Steve Hatcher, Vladimir Correa

The story of one wicked night. Wicked pictures and director Mitchell Spinelli present the story of an imagination run wild. Jonathon Morgan plays a loser in the game of love, whose overactive imagination has a lesson or two to teach him. Imagine it. Anything at all. For a price.

